import React from 'react';

function Login(){
    return (
        <div>
           <h1>Login</h1>
           <form>
           <label>Username:</label>
            <input type="text" name="username" />
            <br />
            <label>Password:</label>
            <input type="text" name="password" />
            <br />
            <input type="submit" />
           </form>
        </div>
    )
}

export default Login;
